('COM', 'Dịch vụ xăng dầu ', 'Công ty Cổ phần Vật tư - Xăng dầu (HOSE)', '141206280000', '14120628', '13752368', 'Sau năm 1975, phòng quản lý xăng dầu thuộc Sở Giao Thông Công Chánh được hình thành để đảm nhận chức năng quản lý và cung ứng xăng dầu trên địa bàn Tp.HCM, sau đó được đổi tên thành Phòng cung ứng xăng dầu, đây là đơn vị tiền thân của Công ty Vật tư Thiết bị Giao thông vận tải. Công ty Vật tư thiết bị Giao thông vận tải được thành lập theo quyết định số 42/QĐ-UB ngày 26/01/1993 của UBND Tp.HCM, hoạt động chủ yếu trong các lĩnh vực: bán sỉ, lẻ xăng dầu, dầu nhờn, vận chuyển nhiên liệu và kinh doanh các loại thiết bị cho ngành giao thông công chính.*Năm 1998, Công ty vật tư thiết bị Giao thông vận tải được UBND Tp.HCM chọn làm đơn vị cổ phần hóa theo quyết định số 4225/QĐ-UB-KT ngày 15/08/1998. Tháng 8/2000, công ty vật tư thiết bị Giao thông Vận tải được Thủ tướng chính phủ phê duyệt Phương án Cổ phần hóa theo quyết định số Ngày 94/2000/QĐ-TTg ngày 09/08/2000 về việc chuyển thành doanh nghiệp Nhà nước Công ty vật tư thiết bị giao thông vận tải thành công ty cổ phần Vật tư - Xăng dầu (COMECO), chính thức hoạt động từ ngày 01/01/2001 với vốn điều lệ 25 tỷ đồng.*Tháng 06/2005, sau khi được UBCKNN cấp giấy chứng nhận đăng ký phát hành, Công ty đã phát hành thêm 900.000 cổ phiếu để huy động vôn và trả cổ tức cho cổ đông, tăng vốn điều lệ lên 34 tỷ đồng.*Ngày 07/08/2006 là ngày chính thức giao dịch đầu tiên của công ty trên trung tâm giao dịch chứng khoán thành phố HCM.', 'Kinh doanh : Xăng, dầu, nhớt, dịch vụ rửa xe; dịch vụ vận chuyển xe bồn.*Thiết bị cho trạm xăng và vật tư, phương tiện giao thông vận tải.*Xây dựng dân dụng và công nghiệp, đặc biệt là các trạm xăng dầu và kho xưởng.*Cho thuê văn phòng, kho, bãi.', 'Số 11 đường Cao Bá Nhạ, phường Nguyễn Cư Trinh, Quận 1, Tp.HCM', '84-(8) 3920 0357/ 3920 0123', 'comecopetro@hcm.vnn.vn', 'http://www.comeco.com.vn / www.comeco.vn', '84-(8) 3920 2296'),
('HNM', 'Sản phẩm sữa ', 'Công ty Cổ phần Sữa Hà Nội (HNX)', '125000000000', '12500000', '12500000', 'Công ty cổ phần sữa Hà Nội thành lập ngày 02/11/2001 theo giấy chứng nhận đăng ký dinh doanh số 0103000592 do sở kế hoạch và đầu tư Hà Nội cấp ngày 02/11/2001.*Ngày 08/03/2002, công ty Cổ Phần Sữa Hà Nội khởi công xây dựng nhà máy chế biến sữa Hà Nội tại địa bàn xã Quang Minh, huyện Mê Linh, tỉnh Vĩnh Phúc dưới hình thức chi nhánh của Công ty theo giấy chứng nhận đăng ký hoạt động chi nhánh số 1913000036 do Sở kế hoạch và đầu tư tỉnh Vĩnh Phúc cấp ngày 19/3/2002. Nhà máy chế biến sữa Hà Nội đã được Uỷ ban nhân dân tỉnh Vĩnh Phúc cấp giấy chứng nhận ưu đãi đầu tư số 1764/CNƯĐĐT ngày 9/5/2002.', 'Sản xuất và buôn bán: sữa bò, sữa đậu nành.*Các sản phẩm từ sữa.*Chế biến các sản phẩn nông sản thực phẩm, các loại nước uống trái cây.*Buôn bán nguyên liệu, thiết bị vật tư và sản phảm ngành sữa, ngành chế biến thực phẩm.*Tư vấn đầu tư nông, công nghiệp.*Xây dựng công trình dân dụng, công nghiệp.*Kinh doanh bất động sản, khách sạn, nhà hàng, siêu thị.*Kinh doanh hạ tầng khu công nghiệp.*Kinh doanh, nuôi trồng chế biến thủy sản.*Đào tạo công nhân kỹ thuật hệ trung học và cao đẳng.*Mua bán xuất nhập khẩu đồ dùng cá nhân và gia đình, vật phẩm quảng cáo, tranh ảnh, đồ chơi (trừ đồ chơi có hại cho giáo dục nhân cách, sức khỏe của trẻ em hoặc ảnh hưởng tới an ninh, trật tự an toàn xã hội). *Máy móc thiết bị văn phòng, văn phòng phẩm.*Đại lý mua, đại lý bán, ký gửi hàng hóa.', 'Khu Công nghiệp Quang Minh, xã Quang Minh, huyện Mê Linh, Hà Nội', '84-(4) 388 665 63 ', 'info@hanoimilk.com', 'http://www.hanoimilk.com', '84-(4) 388 665 64'),
('ONE', 'Công nghệ và Truyền thông', 'Công ty Cổ phần Truyền thông số 1 (HNX)', '50000000000', '5000000', '5000000', 'Năm 1994, công ty TNHH One (tiền thân của One Corporation) được thành lập.*3/2001, công ty TNHH One được chuyển đổi thành Công ty Cổ phần Thương mại và công nghệ tin học Số 1 (ONE JSC) với số vốn điều lệ 10 tỷ đồng, hoạt động chuyên nghiệp trong lĩnh vực viễn thông và mạng dữ liệu.*1/9/2007, One JSC tăng vốn điều lệ lên 20 tỷ đồng để đáp ứng được nhu cầu mở rộng hoạt động kinh doanh và định hướng phát triển của Công ty.*12/2007, Công ty Cổ phần Thương mại và công nghệ tin học Số 1 (ONE JSC) được đổi tên thành Công ty Cổ phần Truyền Thông số 1 (One Corporation).', 'Từ năm 1994 đến 1998: Hoạt động chủ yếu trong lĩnh vực tin học (cung cấp và lắp đặt các hệ thống mạng tin học, cung cấp máy tính và thiết bị ngoại vi)</br>\r\nTừ năm 1998 đến 2000: Mở rộng kinh doanh trong lĩnh vực viễn thông (cung cấp và lắp đặt các hệ thống tổng đài PABX, các hệ thống truyền dẫn quang)</br>\r\nTừ năm 2000 đến 2005: Mở rộng kinh doanh trong lĩnh vực viễn thông (cung cấp và lắp đặt các hệ thống mạng đa dịch vụ)</br>\r\nTừ năm 2005 đến 2007: Mở rộng kinh doanh trong lĩnh vực viễn thông (cung cấp và lắp đặt các hệ thống trung tâm dịch vụ khách hàng – Contact Center, cung cấp cáp quang, các hệ thống thiết bị truy nhập)</br>\r\nHiện nay, các lĩnh vực hoạt động kinh doanh chính của công ty theo giấy chứng nhận đăng ký kinh doanh lần thứ 9 ngày 05 tháng 02 năm 2008 bao gồm:</br>Buôn bán hàng tư liệu sản xuất, hàng tư liệu tiêu dùng.*Dịch vụ về thương mại.*Dịch vụ về điện tử, tin học.*Sản xuất, chuyển giao các phần mềm.*Đại lý mua, đại lý bán, ký gửi hàng hóa; Buôn bán các thiết bị viễn thông.*Buôn bán các thiết bị chống sét.*Tư vấn và thiết kế các hệ thống mạng thông tin, tin học, viễn thông, chống sét, điện công nghiệp, báo cháy, báo trộm, bảo vệ.*Buôn bán và cung cấp các thiết bị điện tử, tin học các hệ thống điện công nghiệp, báo cháy, báo trộm, bảo vệ (không bao gồm thiết kế công trình) .*Thi công lắp đặt, cài đặt các hệ thống mạng thông tin tin học, viễn thông, chống sét, điện công nghiệp đến 110 KV, báo cháy, báo trộm, bảo vệ.*Dịch vụ giải đáp, chăm sóc khách hàng trong lĩnh vực viễn thông (bao gồm cả qua điện thoại).\r\n', '135 Đường Hoàng Ngân, Phường Trung Hoà, Quận Cầu Giấy, Hà Nội.', '84-(4) 976 50 86', 'info@one.com.vn', 'http://www.one.com.vn', '84-(4) 976 51 23'),
('SCD', 'Bia rượu & Nước giải khát ', 'Công ty Cổ phần Nước giải khát Chương Dương (HOSE)', '85000000000', '8500000', '8477640', 'Tiền thân là nhà máy Usine Belgique, được xây dựng vào năm 1952 trực thuộc tập đoàn BGI của Pháp chuyên sản xuất kinh doanh các mặt hàng: bia, nước đá và giải khát các loại. Vào tháng 07/1977 tập đoàn BGI bàn giao toàn bộ nhà máy cho Nhà nước Việt Nam với tên gọi Nhà máy nước ngọt Chương Dương trực thuộc Công ty Rượu Bia Miền Nam.*Năm 1993 công ty đổi tên thành Công ty nước giải khát Chương Dương trực thuộc Tổng công ty Rượu, Bia, Nước giải khát Việt Nam. Năm 1996 công ty sử dụng kho hàng ở số 2 Ngô Đức Kế, HCM để liên doanh với Công ty Centrepoint properties Limited (Singapore) thành lập Công ty TNHH trung tâm Mê Linh xây dựng cao ốc Mê Linh point với tổng vốn đầu tư là 35.722.600 USD.*Tháng 02/06/2004 thực hiện cổ phần hoá và đổi tên thành CTCP Nước giải khát Chương Dương. Vốn điệu lệ của Công ty là 85 tỷ đồng do Tổng công ty Bia Rượu NGK Sài Gòn nắm cổ phần chi phối. Ngày 11/12/2006 công ty được cấp phép niêm yết trên TTGDCK HCM và ngày 25/12/2006 cổ phiếu của công ty chính thức giao dịch trên trung tâm với mã cổ phiếu là SCD*Công ty bắt đầu niêm yết với mã cổ phiếu SCD ngày 25/12/2006 trên sàn giao dịch chứng khoán TP Hồ Chí Minh. Kiểm toán độc lập: Công ty kiểm toán Việt Nam (Vaco).', 'Sản xuất, kinh doanh các loại thức uống.*Sản xuát, kinh doanh nguyên vật liệu, bao bì, thiết bị, công nghệ liên quan đến lĩnh vực thức uống.*Kinh doanh bất động sản.*Kinh doanh các ngành nghề khác theo quy định của pháp luật.*Các sản phẩm chính của công ty bao gồm: nước ngọt đóng chai thuỷ tinh; Nước ngọt đóng lon; Nước ngọt đóng chai PET; Nước giải khát có cồn; Các loại sản phẩm đồ uống khác và các loại nút khoén đóng chai thuỷ tinh.', '379 Bến Chương Dương, Phường Cầu Kho, Quận 1, TP.HCM\r\n', '84-(8) 3836 75 18', NULL, 'http://cdbeco.com.vn', '84-(8) 3836 71 76'),
('TDH', 'Bất động sản ', 'Công ty Cổ phần Phát triển Nhà Thủ Đức (HOSE)', '378750000000', '37875000', '37695010', 'Năm 1992: Lúc mới thành lập Công ty là Doanh nghiệp Nhà Nước với tên gọi Công ty Quản Lý & Phát Triển Nhà Thủ Đức.*Năm 1996: Công ty mở rộng chức năng hoạt động và đổi tên thành Công ty Phát Triển Nhà và Dịch Vụ Khu Công Nghiệp Thủ Đức.*Năm 2000: Công ty chuyển sang Công ty Cổ Phần Phát Triển Nhà Thủ Đức, trên cơ sở pháp lý: Quyết định thành lập số 7967/QĐUBCNN ngày 24/11/2000 của UBND TP. Hồ Chí Minh; Giấy chứng nhận đăng ký kinh doanh số 4103000457 ngày 15/06/2001 do Sở Kế Hoạch và Đầu Tư TP.Hồ Chí Minh cấp.*Vốn điều lệ ban đầu: 15.000.000.000 VNĐ (Mười lăm tỷ đồng). Cơ cấu vốn góp của Nhà nước: Chiếm 20% tổng vốn điều lệ.*Năm 2003: Phần vốn Nhà Nước của Công ty được chuyển giao từ Sở Tài Chính sang Quỹ Đầu Tư Phát Triển Đô Thị Thành Phố quản lý.*Năm 2005: ThuDuc House tăng vốn điều lệ lên gấp đôi là 30.000.000.000 VNĐ (Ba mươi tỷ đồng) .*Năm 2006: Vào ngày 05/06/2006 ThuDuc House đã đăng ký thay đổi vốn điều lệ lên 100.000.000.000 VNĐ (Một trăm tỷ đồng) .*Từ ngày 15/07/2006 ThuDuc House tiếp tục tăng vốn điều lệ thêm 70.000.000.000 VNĐ (Bảy mươi tỷ đồng) nâng tổng vốn điều lệ của Công ty là 170.000.000.000 VNĐ (Một trăm bảy mươi tỷ đồng).*Công ty bắt đầu niêm yết với mã chứng khoán TDH ngày 14/12/2006 trên sàn giao dịch chứng khoán TP Hồ Chí Minh. Tổ chức tư vấn: công ty cổ phần chứng khoán TP Hồ Chí Minh. Kiểm toán độc lập: công ty dịch vụ tư vấn tài chính kế toán và kiểm toán (AASC).', 'Quản lý kinh doanh nhà.*Xây dựng các công trình về nhà ở, công trình công cộng và dân dụng khác.*Sản xuất gạch, ngói, gạch bông.*Thiết kế mẫu nhà ở, công trình dân dụng phục vụ cho nhu cầu xây dựng của đơn vị.*Chủ đầu tư xây dựng và kinh doanh công trình cơ sở hạ tầng khu công nghiệp và dân cư Linh Xuân, Thủ Đức.*San lấp mặt bằng.*Trang trí nội ngoại thất.*Đầu tư xây dưng, kinh doanh cơ sở hạ tầng khu công nghiệp, khu dân cư.*Kinh doanh vận tải hàng hóa bằng ô tô.*Sản xuất, lắp dựng khung nhà tiền chế, kệ thép, các cấu kiện thép: dầm cầu thép, xà, thanh giằng, cột tháp.*Mua bán máy móc thiết bị ngành xây dựng, hàng trang trí nội ngoại thất, vật liệu xây dựng, sắt, thép, đá, cát, sỏi.*Đại lý mua bán xăng, dầu, nhớt.*Hoạt động câu lạc bộ thể dục thể thao: sân tennis, hồ bơi, bóng đá, bóng chuyền, bóng bàn, bóng rổ, cầu lông.*Kinh doanh khách sạn, nhà hàng (không kinh doanh tại trụ sở) .*Mua bán, chế biến hàng nông sản thực phẩm (không chế biến thực phẩm tươi sống).*Cho thuê kho bãi.*Dịch vụ: khai thuê hải quan, quảng cáo, bốc dỡ hàng hóa, đóng gói (trừ thuốc bảo vệ thực vật).*Thiết kế tạo mẫu.*In trên bao bì.*Tổ chức hội chợ, hội nghị, hội thảo, triển lãm thương mại.*Đại lý ký gửi hàng hóa.*Kinh doanh nhà, cho thuê nhà, văn phòng .*Kinh doanh bất động sản.*Dịch vụ định giá bất động sản, dịch vụ sàn giao dịch bất động sản, dịch vụ tư vấn bất động sản, dịch vụ đấu giá bất động sản, dịch vụ quảng cáo bất động sản, dịch vụ quản lý bất động sản.', '13 - 15 - 17 Trương Định, Phường 6, Quận 3, Thành phố Hồ Chí Minh', '84-(8) 39 333 090 ', 'thuduchouse@hcm.vnn.vn', 'http://www.thuduchouse.com', '84-(8) 39 333 123');
