INSERT INTO `stock_expert_analysis` (`analysis_id`, `title`, `pub_date`, `description`, `link`) VALUES
(1, 'Nếu bơm thêm vốn, sẽ vỡ bong bóng', '2011-12-02', 'Đó là nhận định của nguyên Thống đốc Ngân hàng Nhà nước, Tiến sỹ Cao Sỹ Kiêm về thị trường bất động sản (BĐS) hiện nay.', 'http://stox.vn/stox/view_news_detail/103523/1/194/neu-bom-them-von-se-vo-bong-bong.stox'),
(2, 'Ngân hàng lớn cũng không nằm ngoài vòng sáp nhập', '2011-11-30', 'Theo ông Bùi Kiến Thành - chuyên gia kinh tế cao cấp, mặc dù Ngân hàng Nhà nước không đề cập rõ nhưng một số ngân hàng có quy mô lớn mà tiềm lực không mạnh cũng không nằm ngoài vòng sáp nhập.', 'http://stox.vn/stox/view_news_detail/103189/1/194/ngan-hang-lon-cung-khong-nam-ngoai-vong-sap-nhap.stox'),
(3, 'Nên phát hành chứng chỉ vàng để huy động vàng', '2011-11-28', 'Tại diễn đàn Quốc hội, Thống đốc Ngân hàng Nhà nước (NHNN) Nguyễn Văn Bình đã tuyên bố, vàng miếng SJC trở thành nhãn hiệu độc quyền của NHNN.', 'http://stox.vn/stox/view_news_detail/102934/1/194/nen-phat-hanh-chung-chi-vang-de-huy-dong-vang.stox'),
(4, 'Nguyên Phó Thủ tướng Vũ Khoan: &quot;Kinh tế vĩ mô đang có vấn đề&quot;', '2011-11-24', 'Và xa hơn là sự tụt hậu của đất nước trong một thế giới thay đổi rất nhanh và rất sâu sắc.', 'http://stox.vn/stox/view_news_detail/102625/1/194/nguyen-pho-thu-tuong-vu-khoan-kinh-te-vi-mo-dang-co-van-de.stox'),
(5, 'Tái cấu trúc ngân hàng: Nên lựa chọn cả nhà băng ngoại ', '2011-11-16', 'Số lượng các ngân hàng nước ngoài cũng không nên tăng thêm vì hơn 50 chi nhánh ngân hàng nước ngoài và ngân hàng 100% vốn nước ngoài hiện nay đã là quá nhiều cho nền kinh tế.', 'http://stox.vn/stox/view_news_detail/101939/1/194/tai-cau-truc-ngan-hang-nen-lua-chon-ca-nha-bang-ngoai.stox'),
(6, 'Ổn định tỷ giá: Biện pháp trong tầm tay!', '2011-11-15', 'Giữ tỷ giá không tăng quá 1% cho đến hết năm 2011, nguyên Thống đốc Ngân hàng Nhà nước Việt Nam (NHNN) - ông Cao Sỹ Kiêm cho rằng, NHNN hoàn toàn có thể sử dụng nguồn dự trữ ngoại hối để bình ổn thị trường ngoại tệ.', 'http://stox.vn/stox/view_news_detail/101777/1/194/on-dinh-ty-gia-bien-phap-trong-tam-tay.stox'),
(7, 'Quan ngại lớn nhất của thị trường BĐS hiện nay là đầu ra', '2011-11-15', 'Lựa chọn thời điểm ra hàng, đầu ra sản phẩm được tiêu thụ như thế nào trong bối cảnh thị trường khó khăn hiện nay là mối quan ngại lớn nhất của chủ đầu tư hiện nay.', 'http://stox.vn/stox/view_news_detail/101737/1/194/quan-ngai-lon-nhat-cua-thi-truong-bds-hien-nay-la-dau-ra.stox'),
(8, 'Sáp nhập Ngân hàng để mạnh hơn', '2011-11-09', '"Vấn đề là nếu không sáp nhập, hợp nhất thì lộ trình tồn tại và phát triển của hệ thống NH sẽ như thế nào".', 'http://stox.vn/stox/view_news_detail/101122/1/194/sap-nhap-ngan-hang-de-manh-hon.stox'),
(9, 'Phó TGĐ Him Lam Thủ Đô: Mặt bằng giá căn hộ Hà Nội hiện nay chủ đầu tư vẫn lãi 15% - 25%', '2011-11-08', 'Mặc dù giá căn hộ tại Hà Nội đã giảm khoảng 20% so với đầu năm, tuy nhiên, theo phân tích, tính toán của Phó TGĐ Him Lam Thủ Đô thì mức giá này các doanh nghiệp vẫn còn lãi.', 'http://stox.vn/stox/view_news_detail/100997/1/194/pho-tgd-him-lam-thu-do-mat-bang-gia-can-ho-ha-noi-hien-nay-chu-dau-tu-van-lai-15-25.stox'),
(10, 'Đón làn sóng đầu tư từ Hàn Quốc', '2011-11-08', '“Làn sóng đầu tư từ Hàn Quốc vào VN xuất hiện và đi vào chiều sâu” - ông Dương Chính Thức (nguyên đại sứ VN tại Hàn Quốc, hiện là phó chủ tịch Hội Hữu nghị Việt - Hàn) nhận định như trên khi trả lời phỏng vấn.', 'http://stox.vn/stox/view_news_detail/100955/1/194/don-lan-song-dau-tu-tu-han-quoc.stox'),
(11, 'Chủ tịch UBCK: Đề xuất công khai dư nợ margin là thiết thực ', '2011-11-07', 'Kiến nghị về việc công khai dư nợ margin đến từng mã chứng khoán, Chủ tịch UBCK Vũ Bằng cho biết đề xuất này hay và thiết thực, UBCK sẽ xem xét trong quá trình bổ sung, hoàn chỉnh quy định về margin trong thời gian tới.', 'http://stox.vn/stox/view_news_detail/100862/1/194/chu-tich-ubck-de-xuat-cong-khai-du-no-margin-la-thiet-thuc.stox'),
(12, 'Nợ xấu, thanh khoản ngân hàng: Phải &quot;bình tĩnh&quot;', '2011-11-01', 'Đánh giá của Phó chủ tịch Ủy ban Giám sát Tài chính Quốc gia Hà Huy Tuấn về vấn đề nợ xấu và thanh khoản của ngân hàng.', 'http://stox.vn/stox/view_news_detail/100286/1/194/no-xau-thanh-khoan-ngan-hang-phai-binh-tinh.stox'),
(13, 'Các ngân hàng lớn cũng nên xem xét sáp nhập', '2011-10-28', 'Các ngân hàng lớn cũng cần tính tới chuyện sáp nhập để tăng cường lực lượng và khả năng cạnh tranh trên thị trường quốc nội cũng như hướng ra nước ngoài, theo chuyên gia kinh tế Bùi Kiến Thành.', 'http://stox.vn/stox/view_news_detail/99920/1/194/cac-ngan-hang-lon-cung-nen-xem-xet-sap-nhap.stox'),
(14, '''Nhà nước không thể bao bọc các ngân hàng yếu kém''', '2011-10-26', 'Nguyên thống đốc Ngân hàng Nhà nước Cao Sỹ Kiêm cho rằng việc sắp xếp, giải thể ngân hàng phải đặc biệt lưu ý tới quyền lợi người dân, song Nhà nước cũng không thể đứng ra bao bọc hết tài sản xấu của cả hệ thống.', 'http://stox.vn/stox/view_news_detail/99637/1/194/nha-nuoc-khong-the-bao-boc-cac-ngan-hang-yeu-kem.stox'),
(15, 'PGS.TS Trần Hoàng Ngân: Có thể giảm trần lãi suất huy động', '2011-10-24', 'Theo ông Ngân, lạm phát đang có xu hướng giảm dần là cơ sở để tính đến việc giảm trần lãi suất huy động từ 14%/năm còn 13%/năm.', 'http://stox.vn/stox/view_news_detail/99366/1/194/pgs-ts-tran-hoang-ngan-co-the-giam-tran-lai-suat-huy-dong.stox'),
(16, 'Chưa phải thời điểm sáp nhập ngân hàng', '2011-10-19', '“Chưa thể giải thể hay sáp nhập các ngân hàng ngay”- Cựu Thống đốc NHNN Lê Đức Thúy, trao đổi với báo chí bên lề hội thảo “Triển vọng kinh tế thế giới và chính sách ứng phó của Việt Nam”.', 'http://stox.vn/stox/view_news_detail/98988/1/194/chua-phai-thoi-diem-sap-nhap-ngan-hang.stox'),
(17, 'Ngăn chặn sự sụt giảm giá trị đồng tiền Việt Nam: Kéo giảm lạm phát và hút vốn an toàn', '2011-10-18', 'Càng về cuối năm, tỷ giá liên ngân hàng cũng như trên thị trường tự do ngày một leo cao. Làm sao để giữ giá trị đồng tiền Việt và ổn định thị trường ngoại hối?', 'http://stox.vn/stox/view_news_detail/98910/1/194/ngan-chan-su-sut-giam-gia-tri-dong-tien-viet-nam-keo-giam-lam-phat-va-hut-von-an-toan.stox'),
(18, 'Kịch bản ứng phó khủng hoảng', '2011-10-18', '“Cần hoàn thiện khuôn khổ pháp lý để có thể giám sát những rủi ro mang tính hệ thống của thị trường tài chính tiền tệ”- Chủ tịch Ủy ban giám sát tài chính (UBGSTC) Quốc gia Vũ Viết Ngoạn nói.', 'http://stox.vn/stox/view_news_detail/98887/1/194/kich-ban-ung-pho-khung-hoang.stox'),
(19, 'Thị trường tiền tệ: Để &quot;ổn&quot;, cần xử lý tận gốc', '2011-10-11', 'Trong giai đoạn 2001 - 2006, từng có gần hai mươi NHTM nhỏ bị giải tán. Thời gian tới, NHNN cũng sẽ mạnh tay với các NHTM không quản lý chặt chẽ. Chúng tôi đã đề nghị NHNN gây sức ép thật sự với những NHTM nhỏ cần phải sáp nhập hoặc mua lại".', 'http://stox.vn/stox/view_news_detail/98247/1/194/thi-truong-tien-te-de-on-can-xu-ly-tan-goc.stox'),
(20, 'Đầu năm 2012, chứng khoán Việt Nam sẽ khởi sắc ', '2011-10-08', '“Lãi suất cho vay đầu năm 2012 có thể xuống 14-15%, và năm 2013 là 12-13%, khi đó, người dân sẽ chuyển sang các hình thức đầu tư khác, dòng tiền sẽ chảy vào chứng khoán”,', 'http://stox.vn/stox/view_news_detail/98089/1/194/dau-nam-2012-chung-khoan-viet-nam-se-khoi-sac.stox');
