INSERT INTO `stock_news` (`news_id`, `title`, `pub_date`, `description`, `link`) VALUES
(1, 'Khối CTCK chờ một cuộc tái cấu trúc ', '2011-11-16', 'TTCK giảm giá nhiều năm liền khiến một lượng lớn trong số 105 CTCK gần như bị lãng quên do không có hoạt động nào đáng chú ý. Để đảm bảo an toàn cho thị trường và tài sản của NĐT, một cuộc tái cấu trúc lại khối CTCK là không thể chần chừ.', 'http://stox.vn/stox/view_news_detail/101940/1/209/khoi-ctck-cho-mot-cuoc-tai-cau-truc.stox'),
(2, 'Tái cấu trúc ngân hàng: Nên lựa chọn cả nhà băng ngoại ', '2011-11-16', 'Số lượng các ngân hàng nước ngoài cũng không nên tăng thêm vì hơn 50 chi nhánh ngân hàng nước ngoài và ngân hàng 100% vốn nước ngoài hiện nay đã là quá nhiều cho nền kinh tế.', 'http://stox.vn/stox/view_news_detail/101939/1/194/tai-cau-truc-ngan-hang-nen-lua-chon-ca-nha-bang-ngoai.stox'),
(3, 'Đến lượt ACB tăng lãi suất huy động vàng', '2011-11-16', 'Ngày 16/11, Ngân hàng Á châu (ACB) áp dụng biểu lãi suất huy động mới với điều chỉnh tập trung ở chứng chỉ huy động vàng.', 'http://stox.vn/stox/view_news_detail/101937/1/190/den-luot-acb-tang-lai-suat-huy-dong-vang.stox'),
(4, 'TET: Thành viên BKS bán bất thành 10.000 CP', '2011-11-16', 'Bà Thân Thị Quế - Thành viên BKS Công ty Cổ phần Vải sợi May mặc Miền Bắc (TET) giao dịch bất thành 10.000 CP. Sổ cổ phiếu nắm giữ sau giao dịch là 87.160 CP (tỷ lệ 1,53%).', 'http://stox.vn/stox/view_news_detail/101936/1/222/tet-thanh-vien-bks-ban-bat-thanh-10-000-cp.stox'),
(5, 'TJC: Ủy viên HĐQT đã mua 700 CP', '2011-11-16', 'Ông Mai Xuân Ngoạt - Ủy viên HĐQT CTCP Dịch vụ Vận tải và Thương mại (TJC) đã mua 700 CP, tăng lượng cổ phiếu nắm giữ lên 37.800 CP (tỷ lệ 0,63%).', 'http://stox.vn/stox/view_news_detail/101935/1/222/tjc-uy-vien-hdqt-da-mua-700-cp.stox'),
(6, 'TVD: PVF đăng ký bán 200.000 CP', '2011-11-16', 'Tổng Công ty Tài chính Cổ phần Dầu khí Việt Nam - Cổ đông lớn CTCP Than Vàng Danh - Vinacomin (TVD) đăng ký bán 200.000 CP.', 'http://stox.vn/stox/view_news_detail/101934/1/222/tvd-pvf-dang-ky-ban-200-000-cp.stox'),
(7, 'VNF: Góp vốn liên doanh UASC, Nissin', '2011-11-16', 'CTCP Vận Tải Ngoại Thương (VNF) công bố về việc góp vốn liên doanh UASC, Nissin và giải thể công ty liên kết Vax Global.', 'http://stox.vn/stox/view_news_detail/101933/1/157/vnf-gop-von-lien-doanh-uasc-nissin.stox'),
(8, 'APC: Em Kế toán trưởng đã bán toàn bộ CP', '2011-11-16', 'Ông Nguyễn Đắc Hưng – em trai ông Nguyễn Đắc Đoàn – Kế toán trưởng của CTCP Chiếu xạ An Phú (APC) đã bán thành công toàn bộ 2.700 CP.', 'http://stox.vn/stox/view_news_detail/101932/1/222/apc-em-ke-toan-truong-da-ban-toan-bo-cp.stox'),
(9, 'Sacombank: Lo bị thâu tóm ', '2011-11-16', 'Dù không thừa nhận đang là mục tiêu của một nhóm đi thâu tóm, nhưng vài tháng nay, Sacombank đã liên tục tiến hành nhiều biện pháp tự vệ.', 'http://stox.vn/stox/view_news_detail/101931/1/209/sacombank-lo-bi-thau-tom.stox'),
(10, 'DIC: Thông qua việc mua cổ phiếu quỹ', '2011-11-16', 'Hội đồng quản trị của CTCP Đầu tư và Thương mại DIC (DIC) thông qua việc mua lại cổ phiếu làm cổ phiếu quỹ như sau:', 'http://stox.vn/stox/view_news_detail/101930/1/157/dic-thong-qua-viec-mua-co-phieu-quy.stox'),
(11, 'PXI: Tạm ứng cổ tức đợt 1/2011 bằng tiền mặt tỷ lệ 10%', '2011-11-16', 'Sở GDCK Tp.HCM thông báo ngày đăng ký cuối cùng chốt danh sách cổ đông trả cổ tức đợt 1/2011 bằng tiền mặt theo tỷ lệ 10% của CTCP Xây dựng công nghiệp & Dân dụng Dầu khí (PXI).', 'http://stox.vn/stox/view_news_detail/101929/1/157/pxi-tam-ung-co-tuc-dot-1-2011-bang-tien-mat-ty-le-10.stox'),
(12, 'VFG: FTIF đăng ký bán ròng 621.907 CP', '2011-11-16', 'FTIF – Templeton Frontier Markets Fund cổ đông lớn của CTCP Khử trùng Việt Nam (VFG) đăng ký bán ròng 621.907 CP kể từ ngày 21/11/2011.', 'http://stox.vn/stox/view_news_detail/101928/1/222/vfg-ftif-dang-ky-ban-rong-621-907-cp.stox'),
(13, 'HDG: Chủ tịch HĐQT đăng ký mua 2,3 triệu CP', '2011-11-16', 'Ông Nguyễn Trọng Thông – Chủ tịch HĐQT của CTCP Tập đoàn Hà Đô (HDG) đăng ký mua vào 2,3 triệu CP kể từ ngày 21/11/2011.', 'http://stox.vn/stox/view_news_detail/101927/1/222/hdg-chu-tich-hdqt-dang-ky-mua-2-3-trieu-cp.stox'),
(14, 'HDG: Chủ tịch HĐQT đã mua trên 3,88 triệu CP', '2011-11-16', 'Ông Nguyễn Trọng Thông – Chủ tịch HĐQT của CTCP Tập đoàn Hà Đô (HDG) đã mua 3,88 triệu CP,  nâng số CP nắm giữ sau giao dịch lên trên 7 triệu CP.', 'http://stox.vn/stox/view_news_detail/101926/1/222/hdg-chu-tich-hdqt-da-mua-tren-3-88-trieu-cp.stox'),
(15, 'HDG: Cổ đông lớn cá  nhân đã bán thành công toàn bộ CP', '2011-11-16', 'Bà Nguyễn Thùy Chi – cổ đông lớn cá nhân của CTCP Tập đoàn Hà Đô (HDG) đã bán thành công toàn bộ trên 3,33 triệu CP.', 'http://stox.vn/stox/view_news_detail/101925/1/222/hdg-co-dong-lon-ca-nhan-da-ban-thanh-cong-toan-bo-cp.stox'),
(16, 'SCR: SBT đăng ký mua 4 triệu cổ phiếu', '2011-11-16', 'Từ 21/11/2011-16/01/2012, CTCP Bourbon Tây Ninh (mã CK: SBT) đăng ký mua ròng 4 triệu cổ phiếu của CTCP Địa ốc Sài Gòn Thương Tín (SCR).', 'http://stox.vn/stox/view_news_detail/101924/1/198/scr-sbt-dang-ky-mua-4-trieu-co-phieu.stox'),
(17, 'TET: Giải trình LNST hợp nhất Quý III/2011 tăng 30,7% so với cùng kỳ', '2011-11-16', 'Công ty Cổ phần Vải sợi May mặc Miền Bắc (TET) giải trình LNST hợp nhất Quý III/2011 tăng 30,7% so với Quý III/2010.', 'http://stox.vn/stox/view_news_detail/101922/1/157/tet-giai-trinh-lnst-hop-nhat-quy-iii-2011-tang-30-7-so-voi-cung-ky.stox'),
(18, 'TLT: Điều chỉnh giảm 91,4% kế hoạch lợi nhuận năm 2011', '2011-11-16', 'CTCP Vigalcera Thăng Long (TLT) thông báo Nghị quyết ĐHCĐ bất thường ngày 10/11/2011 thông qua việc điều chỉnh kế hoạch kinh doanh năm 2011.', 'http://stox.vn/stox/view_news_detail/101921/1/197/tlt-dieu-chinh-giam-91-4-ke-hoach-loi-nhuan-nam-2011.stox'),
(19, 'HPB: Đã mua 150.000 cổ phiếu quỹ', '2011-11-16', 'CTCP Bao bì PP (HPB) đã mua 150.000 cổ phiếu quỹ, tăng lượng cổ phiếu nắm giữ lên 172.800 CP.', 'http://stox.vn/stox/view_news_detail/101920/1/222/hpb-da-mua-150-000-co-phieu-quy.stox'),
(20, 'PVI: HDI- Gerling Industrie Versicherung AG đã mua 53,2 triệu CP', '2011-11-16', 'CTCP PVI (PVI) thông báo, HDI- Gerling Industrie Versicherung AG đã mua 53,2 triệu cổ phiếu và trở thành cổ đông lớn của Công ty từ 11/11/2011.', 'http://stox.vn/stox/view_news_detail/101918/1/222/pvi-hdi-gerling-industrie-versicherung-ag-da-mua-53-2-trieu-cp.stox'),
(21, 'Chính sách tiền tệ: Hài hòa và tối ưu hóa lợi ích', '2011-12-04', 'Trả lời chất vấn của Thống đốc thể hiện chủ trương hài hòa các lợi ích trong điều hành chính sách tiền tệ và tối ưu hóa lợi ích xã hội, lợi ích của toàn dân.', 'http://stox.vn/stox/view_news_detail/103617/1/186/chinh-sach-tien-te-hai-hoa-va-toi-uu-hoa-loi-ich.stox'),
(22, 'Bảo hiểm Quân đội tăng vốn điều lệ lên 400 tỷ đồng ', '2011-12-04', 'Theo tin từ Tổng CTCP bảo hiểm Quân đội (MIC), Bộ Tài chính đã cấp giấy phép điều chỉnh vốn điều lệ của công ty lên 400 tỷ đồng. Trước đó, vốn điều lệ của công ty là 300 tỷ đồng.', 'http://stox.vn/stox/view_news_detail/103616/1/197/bao-hiem-quan-doi-tang-von-dieu-le-len-400-ty-dong.stox'),
(23, 'PHR ước lãi 752 tỷ đồng 11 tháng, vượt 22% kế hoạch', '2011-12-04', 'Trong tháng 11, lợi nhuận của CTCP Cao Su Phước Hòa (HOSE: PHR) ước đạt 59.8 tỷ đồng, nâng lũy kế 11 tháng lên 752 tỷ đồng, vượt 22% kế hoạch năm.', 'http://stox.vn/stox/view_news_detail/103615/1/193/phr-uoc-lai-752-ty-dong-11-thang-vuot-22-ke-hoach.stox'),
(24, 'L18: Chủ tịch HĐQT kiêm Tổng Giám đốc đã mua 18.700 CP', '2011-12-04', 'Ông Đặng Văn Giang Chủ tịch Hội đồng quản trị kiêm Tổng Giám Đốc Công ty Cổ Phần Công ty Cổ phần Đầu tư và Xây dựng số 18 (L18) đã mua 18.700 CP từ ngày 05/10/2011 đến 01/12/2011', 'http://stox.vn/stox/view_news_detail/103613/1/222/l18-chu-tich-hdqt-kiem-tong-giam-doc-da-mua-18-700-cp.stox'),
(25, 'L18: Ủy viên HĐQT đăng ký mua 30.000 CP', '2011-12-04', 'Ông Nguyễn Đình Thủy Ủy viên HĐQT Công ty Cổ Phần Công ty Cổ phần Đầu tư và Xây dựng số 18 (L18) đăng ký mua 30.000 CP từ ngày 05/12/2011 đến 31/01/2012', 'http://stox.vn/stox/view_news_detail/103612/1/222/l18-uy-vien-hdqt-dang-ky-mua-30-000-cp.stox'),
(26, 'Cơ hội đột phá của kinh tế Việt Nam', '2011-12-04', 'Những tiến bộ trong 15 năm qua đã đem về cho Việt Nam các thành quả lớn về nông nghiệp như số lượng gạo, cà phê, cao su, hải sản xuất khẩu luôn là “top ten” của thế giới.', 'http://stox.vn/stox/view_news_detail/103611/1/188/co-hoi-dot-pha-cua-kinh-te-viet-nam.stox'),
(27, 'Mở cửa cho vay tiêu dùng địa ốc: Cứu người - cứu mình ?', '2011-12-04', 'Nhiều ngân hàng thương mại (NHTM) đã lên kế hoạch cho vay trở lại đối với địa ốc tiêu dùng sau khi 4 nhóm địa ốc được đưa ra khỏi rổ tín dụng phi sản xuất.', 'http://stox.vn/stox/view_news_detail/103610/1/184/mo-cua-cho-vay-tieu-dung-dia-oc-cuu-nguoi-cuu-minh.stox'),
(28, 'Hạ lãi suất: Mấy phần trăm và thời điểm nào? ', '2011-12-04', 'Thời gian tới, người dân và các doanh nghiệp có thể chứng kiến những thay đổi về lãi suất - có tính ảnh hưởng bước ngoặt đối với nền kinh tế Việt Nam trong năm 2012 và có thể cả năm 2013.', 'http://stox.vn/stox/view_news_detail/103614/1/186/ha-lai-suat-may-phan-tram-va-thoi-diem-nao.stox'),
(29, 'Vì sao NHNN cần độc quyền vàng miếng?', '2011-12-04', 'Gần đây, Thống đốc Ngân hàng Nhà nước (NHNN) Nguyễn Văn Bình đã tuyên bố vàng SJC sẽ trở thành nhãn hiệu vàng của NHNN, đơn vị này phải độc quyền quản lý, sản xuất vàng miếng, điều này không những đúng về lý thuyết mà còn đúng cả về thực tế.', 'http://stox.vn/stox/view_news_detail/103609/1/185/vi-sao-nhnn-can-doc-quyen-vang-mieng.stox'),
(30, 'Tái cơ cấu ngân hàng: Cơ hội cho nhà đầu tư ngoại', '2011-12-04', 'Nâng tỉ lệ cổ phần của đối tác chiến lược nước ngoài, không tăng vốn điều lệ để khuyến khích hợp nhất... là một số kiến nghị của EuroCham Việt Nam khi nói về tái cấu trúc hệ thống ngân hàng Việt Nam.', 'http://stox.vn/stox/view_news_detail/103618/1/186/tai-co-cau-ngan-hang-co-hoi-cho-nha-dau-tu-ngoai.stox'),
(31, 'Thị trường bất động sản TPHCM: Bất động trong mùa cao điểm', '2011-12-04', 'Thị trường BĐS khu vực phía nam đang có những diễn biến  trái chiều. Các dự án BĐS giá rẻ trên địa bàn các tỉnh Đông Nam Bộ đang tung hàng ra bán để đón mùa cao điểm cuối năm.', 'http://stox.vn/stox/view_news_detail/103608/1/184/thi-truong-bat-dong-san-tphcm-bat-dong-trong-mua-cao-diem.stox'),
(32, 'Nhập nhèm phí chung cư, người dân bất bình!', '2011-12-04', 'Sau hơn 4 năm đi vào hoạt động, việc quản lý vận hành chung cư Đất Phương Nam (Q.Bình Thạnh, TPHCM) vẫn còn… ngổn ngang bất cập.', 'http://stox.vn/stox/view_news_detail/103607/1/184/nhap-nhem-phi-chung-cu-nguoi-dan-bat-binh.stox'),
(33, 'Cá tra: Không nên tiếp tục chạy theo sản lượng', '2011-12-04', 'Ngành nuôi và chế biến cá tra xuất khẩu hẳn chưa thể quên năm 2008, thời điểm sản lượng cá tra đột ngột tăng tới 50%, đẩy ngành này vào một giai đoạn khó khăn kéo dài suốt ba năm.', 'http://stox.vn/stox/view_news_detail/103606/1/191/ca-tra-khong-nen-tiep-tuc-chay-theo-san-luong.stox'),
(34, 'Nhiều phương án bảo đảm an toàn tiền gửi', '2011-12-04', 'Nhiều giải pháp đang được Ngân hàng Nhà nước Việt Nam (NHNN VN) triển khai nhằm giúp các ngân hàng (NH) vượt qua giai đoạn khó khăn hiện nay.', 'http://stox.vn/stox/view_news_detail/103605/1/190/nhieu-phuong-an-bao-dam-an-toan-tien-gui.stox'),
(35, 'Kỳ vọng lạm phát 2012 của Việt Nam có thực tế? ', '2011-12-04', 'Lúc này vẫn còn quá sớm để Chính phủ Việt Nam đảm bảo sự tự tin với mục tiêu đưa lạm phát 2012 xuống một con số.', 'http://stox.vn/stox/view_news_detail/103604/1/188/ky-vong-lam-phat-2012-cua-viet-nam-co-thuc-te.stox'),
(36, 'Tái cơ cấu để thoát &quot;bẫy tăng trưởng&quot;', '2011-12-04', 'Với chủ đề “Giai đoạn mới cho tăng trưởng cạnh tranh”, Diễn đàn Doanh nghiệp Việt Nam (VBF) 2011 tại Hà Nội ngày 2-12 khuyến nghị Việt Nam hoàn thiện hơn nữa môi trường kinh doanh và đầu tư', 'http://stox.vn/stox/view_news_detail/103603/1/188/tai-co-cau-de-thoat-bay-tang-truong.stox'),
(37, 'Chứng khoán và &quot;những cuộc chia ly màu đỏ&quot; ', '2011-12-04', 'Sáng 2/12, cộng đồng nhà đầu tư gửi cho nhau bức thư chia tay của Tổng giám đốc CTCK Thăng Long (TLS). Không chỉ các “sao” đổi ngôi trên thị trường này, mà sự khốc liệt còn khiến nhiều nhà đầu tư kỳ cựu “ngã ngựa”.', 'http://stox.vn/stox/view_news_detail/103602/1/209/chung-khoan-va-nhung-cuoc-chia-ly-mau-do.stox'),
(38, 'Sẽ sáp nhập Jetstar Pacific vào Vietnam Airlines ', '2011-12-04', 'Hãng hàng không giá rẻ Jetstar Pacific sẽ được sáp nhập vào Hãng hàng không Quốc gia Việt Nam (Vietnam Airlines) trong tương lai không xa.', 'http://stox.vn/stox/view_news_detail/103601/1/226/se-sap-nhap-jetstar-pacific-vao-vietnam-airlines.stox'),
(39, 'Chứng khoán &quot;hồi sinh&quot;: Tia hy vọng mong manh', '2011-12-04', 'Thời điểm cuối cùng của năm đã đến gần, song những thách thức, khó khăn vẫn tiếp tục “treo lơ lửng” trên thị trường chứng khoán.', 'http://stox.vn/stox/view_news_detail/103600/1/209/chung-khoan-hoi-sinh-tia-hy-vong-mong-manh.stox'),
(40, 'BĐS ở Bình Dương: Nghịch lý &quot;không gian ba chiều&quot;', '2011-12-04', 'Hàng loạt nền đất rao khuyến mãi lớn “mua một nền tặng ngay bộ móng” song ít người ngó đến. Trong khi hàng loạt nhà phố bạc tỷ đục tường, đục lỗ nuôi chim yến thì những người có nhu cầu mua đất để ở thật sự “săn lùng” không ra.', 'http://stox.vn/stox/view_news_detail/103599/1/184/bds-o-binh-duong-nghich-ly-khong-gian-ba-chieu.stox');
